webpackJsonp([207],{"./node_modules/json-loader/index.js!./.cache/json/articles-python-python-absx-function.json":function(e,t){e.exports={data:{markdownRemark:{html:'<p><code>abs()</code> is a built-in function in Python 3, to compute the absolute value of any number. It takes one argument <code>x</code>. The argument can even be a <a href="https://docs.python.org/3.0/library/cmath.html">complex number</a>, and in that case its <a href="http://www.mathcentre.ac.uk/resources/sigma%20complex%20number%20leaflets/sigma-complex9-2009-1.pdf">modulus</a> is returned.</p>\n<h2>Argument</h2>\n<p>It takes one argument <code>x</code> - an integer, or decimal, or a complex number.</p>\n<h2>Return Value</h2>\n<p>The return value would be a positive number. Even if complex number is passed, it would return its magnitude, computed as per complex number algebra.</p>\n<h2>Code Sample</h2>\n<pre><code>print(abs(3.4)) # prints 3.4\nprint(abs(-6)) # prints 6\nprint(abs(3 + 4j)) # prints 5, because |3 + 4j| = 5\n</code></pre>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/CL8k/0">Run Code</a></p>\n<p><a href="https://docs.python.org/3/library/functions.html#abs">Official Docs</a></p>',frontmatter:{title:"Python Absx Function",parent:"/home/stuart/guides/src/pages/articles/python/python-absx-function/index.md absPath of file"}}},pathContext:{slug:"/articles/python/python-absx-function/"}}}});
